import React from "react";

const MyCourse = (userReview = null) => {
  console.log("마이코스", userReview.userReview);
  return;
  <div>
    {userReview.userReview.name}
    {userReview.userReview.info}
    {userReview.userReview.opt}
    {userReview.userReview.name}
  </div>;
};

export default MyCourse;
